import React, { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import "./AdoptionContact.css";

const AdoptionContact = () => {
  const { animalName } = useParams();

  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone: "",
    date: "",
    time: "",
    message: "",
  });

  const [submitted, setSubmitted] = useState(false);

  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Formularz wys≈Çany:", formData);
    setSubmitted(true);
    setFormData({
      name: "",
      email: "",
      phone: "",
      date: "",
      time: "",
      message: "",
    });
  };

  return (
    <section
      className="contact-container"
      style={{
        backgroundImage: "url(/img/contact.jpg)",
        backgroundSize: "cover",
        backgroundPosition: "center",
        position: "relative",
        overflow: "hidden",
      }}
    >
      <div className="contact-bg"></div>

      <div className="contact-header">
        <h1>Adopcja: {animalName}</h1>
        <p>Wype≈Çnij formularz, aby um√≥wiƒá siƒô na spotkanie w sprawie adopcji</p>
      </div>

      <div className="contact-content">
        <div className="contact-info">
          <h2>Schronisko ‚ÄûAdoptuj przyjaciela‚Äù</h2>
          <p><strong>Adres:</strong> ul. Le≈õna 12, 00-000 Warszawa</p>
          <p><strong>Telefon:</strong> +48 123 456 789</p>
          <p><strong>Email:</strong> kontakt@adoptujprzyjaciela.pl</p>
          <p><strong>Godziny otwarcia:</strong><br />
            Poniedzia≈Çek: 9:00 ‚Äì 17:00<br />
            Wtorek: 9:00 ‚Äì 17:00<br />
            ≈öroda: 9:00 ‚Äì 17:00<br />
            Czwartek: 8:00 ‚Äì 18:00<br />
            PiƒÖtek: 8:00 ‚Äì 18:00<br />
            Sobota: 9:00 ‚Äì 15:00<br />
            Niedziela: 10:00 - 14:00
          </p>
        </div>

        <div className="contact-form">
          <h2>Formularz adopcyjny</h2>

          {submitted ? (
            <div className="form-success">
              <p>Dziƒôkujemy! Twoja wiadomo≈õƒá zosta≈Ça wys≈Çana üêæ</p>
            </div>
          ) : (
            <form onSubmit={handleSubmit}>
              <input
                type="text"
                name="name"
                placeholder="Twoje imiƒô i nazwisko"
                value={formData.name}
                onChange={handleChange}
                required
              />
              <input
                type="email"
                name="email"
                placeholder="Tw√≥j email"
                value={formData.email}
                onChange={handleChange}
                required
              />
              <input
                type="tel"
                name="phone"
                placeholder="Telefon (opcjonalnie)"
                value={formData.phone}
                onChange={handleChange}
              />

              <label>Wybierz dzie≈Ñ wizyty:</label>
              <input
                type="date"
                name="date"
                value={formData.date}
                onChange={handleChange}
                required
                min={new Date().toISOString().split("T")[0]}
              />

              <label>Wybierz godzinƒô (10:00 - 18:00):</label>
              <input
                type="time"
                name="time"
                value={formData.time}
                onChange={handleChange}
                required
                min="10:00"
                max="18:00"
              />

              <textarea
                name="message"
                placeholder="Twoja wiadomo≈õƒá"
                value={formData.message}
                onChange={handleChange}
                rows="5"
              ></textarea>

              <button type="submit">Wy≈õlij wiadomo≈õƒá</button>
            </form>
          )}
        </div>
      </div>
    </section>
  );
};

export default AdoptionContact;
